			ConVar* sv_cheats = g_Interfaces->cvar->FindVar( "sv_cheats" );
			*( int* )( ( DWORD )&sv_cheats->m_fnChangeCallbacks + 0xC ) = 0;
			sv_cheats->SetValue( 1 );
			g_Interfaces->gameEngine->executeCmd( "thirdperson" );
